import React from 'react';
import classes from '../css/Nav.module.css';
import {Link} from 'react-router-dom';

const Nav = () => {
    return (
        <nav className={classes.nav}>
            <div>
                <Link to="/profile">
                    
                </Link>
            </div>
            <div>
                <Link to="/messages">
                    
                </Link>
            </div>
            <div>
                <Link to="/news">
                    
                </Link>
            </div>
            <div>
                <Link to="/music">
                    
                </Link>
            </div>
            <div>
                <Link to="/settings">
                    
                </Link>
            </div>
      </nav>
    );
}

export default Nav;
